			style={{
				display: 'flex',
				alignItems: 'center',
				justifyContent: 'center',
				background: '#2A2A2A',
			}}
		>
			<p style={{ margin: '0', padding: '0', fontSize: '25px' }}>
				Built by Web Development at Berkeley
			</p>
		</footer>
	);
};

export default Landing;
